tables.table_schema:
CREATE TABLE telehealth_video_logs (
    call_id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    participant_name VARCHAR(50) NOT NULL,
    participant_role VARCHAR(20) NOT NULL
);

CREATE TABLE telehealth_video_call_logs (
    call_id UUID PRIMARY KEY,
    timestamp TIMESTAMP,
    participant_name VARCHAR,
    participant_email VARCHAR
);

CREATE TABLE telehealth_participants (
    participant_id UUID PRIMARY KEY,
    participant_name VARCHAR,
    participant_email VARCHAR,
    role VARCHAR
);

CREATE TABLE video_call_logs (
  call_id UUID PRIMARY KEY,
  timestamp TIMESTAMP NOT NULL,
  caller_name VARCHAR(255) NOT NULL,
  callee_name VARCHAR(255) NOT NULL
);

CREATE TABLE participants (
  participant_id UUID PRIMARY KEY,
  participant_name VARCHAR(255) NOT NULL,
  email VARCHAR(255) NOT NULL,
  phone_number VARCHAR(20)
);

CREATE TABLE audit_logs (
  log_id UUID PRIMARY KEY,
  timestamp TIMESTAMP NOT NULL,
  action_performed VARCHAR(100) NOT NULL
);

CREATE TABLE user_accounts (
  user_id UUID PRIMARY KEY,
  username VARCHAR NOT NULL,
  email VARCHAR NOT NULL UNIQUE,
  password_hash VARCHAR NOT NULL
);

CREATE TABLE audit_logs (
  log_id UUID PRIMARY KEY,
  timestamp TIMESTAMP NOT NULL,
  event_type VARCHAR NOT NULL,
  description TEXT
);

CREATE TABLE healthcare_providers (
  provider_id UUID PRIMARY KEY,
  provider_name VARCHAR NOT NULL,
  location VARCHAR NOT NULL,
  contact_info JSONB
);

CREATE TABLE participants (
   participant_id INT PRIMARY KEY,
   participant_name VARCHAR(100) NOT NULL,
   participant_email VARCHAR(100) NOT NULL
);
